  dp1: "Si est\xE1 buscando la forma m\xE1s r\xE1pida de depositar, simplemente inicie sesi\xF3n en su cuenta a trav\xE9s de nuestro sitio web y visite el Cajero para depositar.",
  dp2: "T\xC9RMINOS Y CONDICIONES DEL PROCESAMIENTO DE TRANSACCIONES",
  dp3: "Usted acepta y reconoce que:",
  dp4: "Haremos todos los esfuerzos razonables para garantizar que los dep\xF3sitos y retiros se procesen de manera oportuna. No garantizamos el tiempo requerido para completar el procesamiento.",
  dp5: "No podemos responsabilizarnos por demoras en las redes bancarias, fallas del procesador o acciones de otras partes involucradas en el procesamiento de fondos que puedan resultar en demoras en el procesamiento, reprocesamiento o reversi\xF3n de transacciones o incautaci\xF3n o congelaci\xF3n de fondos, ni seremos responsables de ning\xFAn da\xF1o real o consecuente que surja de cualquier reclamo de demora o incautaci\xF3n.",
  dp6: "No seremos responsables de ning\xFAn da\xF1o real o consecuente que surja de cualquier reclamo de demora o p\xE9rdida como resultado de datos financieros o personales inv\xE1lidos, incompletos o err\xF3neos proporcionados por el Usuario con su solicitud de dep\xF3sito o retiro.",
  dp7: "Como parte de nuestro acuerdo de licencia y en cumplimiento de la legislaci\xF3n contra el lavado de dinero, los usuarios deben tener en cuenta que es posible que deban presentar documentaci\xF3n personal (como identificaci\xF3n emitida por el gobierno, estados de cuenta bancarios y de facturas de servicios p\xFAblicos, verificaci\xF3n telef\xF3nica y documentos SOW) a pedido para que se procese su transferencia.",
  dp8: "Esto nos permite ayudar a proteger a los Usuarios y evita que nuestra plataforma se utilice como veh\xEDculo para el lavado de dinero o el fraude.",
  dp9: "Los fondos de los jugadores y los saldos de las cuentas se mantienen en cuentas separadas por nosotros y no se utilizan para ning\xFAn gasto operativo.",
  dp10: "Este acuerdo garantiza que siempre podamos cumplir con nuestras obligaciones monetarias con nuestros jugadores en l\xEDnea y brinda una mayor seguridad de que los fondos de los jugadores siempre est\xE1n seguros con nosotros.",
  se0: "Autoexclusi\xF3n",
  se1: "Europa777 reconoce que, si bien la mayor\xEDa de los jugadores juegan por entretenimiento, los juegos pueden ser perjudiciales para un peque\xF1o n\xFAmero de personas. Estamos comprometidos a crear un entorno de juego responsable.",
  se2: "Si le preocupa su comportamiento en el juego, considere optar por no participar.",
  se3: "Europa777 se compromete a brindar a nuestros jugadores una experiencia de juego agradable y segura. Si elige optar por no participar, su cuenta de juego con Europa777 se excluir\xE1 inmediatamente durante el per\xEDodo elegido.",
  se4: "Esto significa que no podr\xE1 iniciar sesi\xF3n, depositar o jugar con Europa777 mientras est\xE9 autoexcluido. Tenga en cuenta que no podr\xE1 volver a abrir su cuenta hasta que haya vencido el per\xEDodo de autoexclusi\xF3n elegido.",
  se5: "Tambi\xE9n tomaremos todas las medidas razonables para garantizar que no reciba ning\xFAn material promocional durante este tiempo. Sin embargo, si utiliza los canales de las redes sociales, le recomendamos encarecidamente que tome medidas para asegurarse de no recibir ninguna noticia o actualizaci\xF3n nuestra.",
  se6: "Tiene la opci\xF3n de darse de baja de 6 meses a 5 a\xF1os.",
  se7: "Tambi\xE9n le recomendamos que se autoexcluya con cualquier otro operador con el que pueda estar registrado.",
  se8: "Para solicitar una autoexclusi\xF3n, comun\xEDquese con nuestro equipo de soporte por correo electr\xF3nico, chat O puede ingresar una autoexclusi\xF3n de su",
  se9: "Mi perfil",
  se10: "cuenta",
  se11: "Manteniendo el control",
  se12: "Reconocemos que, si bien la mayor\xEDa de los jugadores juegan por entretenimiento, hay un peque\xF1o n\xFAmero que puede perder el control de su juego. Europa777 apoya totalmente el juego responsable y para garantizar que contin\xFAe disfrutando de un juego seguro y manejable, tenga en cuenta lo siguiente",
  se13: "El juego debe verse como un entretenimiento, no como un medio para ganar dinero.",
  se14: "Lleve un registro del tiempo y el dinero que gasta mientras juega",
  se15: "Use l\xEDmites para ayudar a mantener el control",
  se16: "La siguiente lista es una variedad de medidas y herramientas para ayudarlo a realizar un seguimiento del tiempo y el dinero que gasta en uno de los sitios web de BV Games & More.",
  se17: "L\xEDmite de apuesta para controlar cu\xE1nto apuestas",
  se18: "L\xEDmite de dep\xF3sito para limitar cu\xE1nto puede depositar en su cuenta BV Games & More",
  se19: "El l\xEDmite de p\xE9rdidas te ayuda a no gastar de m\xE1s en tu presupuesto",
  se20: "L\xEDmite m\xE1ximo de apuesta para protegerse de colocar accidentalmente un giro o apuesta m\xE1s alto de lo previsto",
  se21: "L\xEDmite de tiempo para controlar que no pases m\xE1s tiempo del planificado por sesi\xF3n de juego",
  se22: "Verificaci\xF3n de la realidad para recibir informaci\xF3n sobre sus ganancias netas en su sesi\xF3n actual",
  se23: "Bloquear cuenta es una herramienta para usar si necesita un breve descanso de su juego",
  se24: "Antes de empezar a jugar, te recomendamos que eches un vistazo y hagas uso de nuestros l\xEDmites.",
  se25: "Si necesita un descanso del juego, la autoexclusi\xF3n se puede configurar desde la secci\xF3n 'Mi cuenta' mientras est\xE1 conectado o comunic\xE1ndose con nuestro departamento de atenci\xF3n al cliente por correo electr\xF3nico o chat.",
  se26: "Si necesita hablar con alguien sobre cualquier inquietud que pueda tener sobre su juego, comun\xEDquese con una de las organizaciones, que puede encontrar en Grupos de apoyo. Bloquear el acceso a sitios de apuestas en l\xEDnea",
