  frtm0: "M\xE9todos de prueba de imparcialidad y RNG",
  frtm1: "Europa777 est\xE1 comprometida con altos est\xE1ndares de servicio al cliente y con una conducta justa y abierta en sus operaciones de juego.",
  frtm2: "El resultado de los productos de Poker, Casino y Live Casino, que Europa777 pone a disposici\xF3n de sus clientes, est\xE1 determinado por un generador de n\xFAmeros aleatorios certificado y auditado, que opera con un alto nivel de encriptaci\xF3n y aleatoriedad para garantizar la equidad sin excepci\xF3n y sin interferencia humana ('RNG').",
  frtm3: "El RNG es administrado por proveedores de Casino y Live Casino y cada uno de ellos ha pasado y superado pruebas de cumplimiento externas. Esto garantiza que los juegos, una vez integrados en nuestro sitio web, funcionen como se espera en t\xE9rminos de experiencia del usuario.",
  frtm4: "El valor de Retorno al jugador (RTP) es un c\xE1lculo te\xF3rico del retorno porcentual promedio/esperado del dinero total apostado en una gran cantidad de jugadas (por ejemplo, cientos de millones de juegos).",
  frtm5: "Si bien puede ganar una gran cantidad o perder su apuesta en cualquier juego individual, el rendimiento promedio de un juego espec\xEDfico jugado durante un largo per\xEDodo de tiempo se acercar\xE1 al valor RTP te\xF3rico.",
  frtm6: "Este valor te\xF3rico se calcula mediante m\xE9todos anal\xEDticos (que a menudo es posible para juegos que no dependen de la estrategia, como las tragamonedas) o mediante simulaciones por computadora de aquellos juegos m\xE1s complejos o dependientes de la estrategia (por ejemplo, blackjack, ruleta, etc.)",
  frtm7: "Para obtener m\xE1s informaci\xF3n sobre la imparcialidad de juegos espec\xEDficos, visite la secci\xF3n de informaci\xF3n del juego correspondiente. Si no puede encontrar esta informaci\xF3n, comun\xEDquese con nuestro equipo de atenci\xF3n al cliente que lo ayudar\xE1 m\xE1s.",
  frtm8: "Al jugar juegos de casino en nuestro sitio web, usted reconoce y acepta que nuestro RNG determinar\xE1 el resultado de los juegos que juegue y que aceptar\xE1 los resultados de todos esos juegos.",
  frtm9: "En caso de discrepancia entre el resultado que aparece en la pantalla de su dispositivo y el servidor del juego, prevalecer\xE1 el resultado que aparece en el servidor del juego. Adem\xE1s, reconoce y acepta que nuestros registros ser\xE1n concluyentes en relaci\xF3n con cualquier disputa que surja de su actividad de juego en nuestro sitio web.",
  frtm10: "Para obtener m\xE1s informaci\xF3n, p\xF3ngase en contacto con nuestro equipo de atenci\xF3n al cliente",
