  bt3: "La oferta de bienvenida combinada de hasta $1800 consiste en lo siguiente:",
  bt4: "Bono de bienvenida del 200% hasta $600 en el primer dep\xF3sito m\xE1s 100 giros gratis. C\xF3digo de promoci\xF3n: 1STDEP",
  bt5: "Bono del 100% hasta $600 en el segundo dep\xF3sito. C\xF3digo de promoci\xF3n: 2NDDEP",
