  bt7: "Cualquier bono estar\xE1 limitado a un valor de retiro m\xE1ximo de 6 veces el monto de su dep\xF3sito y cualquier saldo restante se perder\xE1. Esta cl\xE1usula solo se aplicar\xE1 a discreci\xF3n de la administraci\xF3n del casino.",
  bt8: "El retiro m\xE1ximo en giros gratis es de $50 o el equivalente en su moneda. Aseg\xFArese de tener fondos suficientes disponibles antes de solicitar un retiro. Cuando solicite un retiro, el monto del bono se restar\xE1 autom\xE1ticamente.",
  bt9: "Debido a la importancia de un juego justo, existe un l\xEDmite en el tama\xF1o m\xE1ximo de la apuesta que se puede colocar durante el juego de cualquier bono de promoci\xF3n (incluidas las ofertas de reembolso). A menos que se indique lo contrario, la cantidad m\xE1xima de apuesta permitida es de $5 o el equivalente en su moneda. Se anular\xE1n todas las ganancias si apuesta m\xE1s de $ 5 o el equivalente en la moneda durante un juego activo.",
  bt10: "La apuesta debe realizarse cuando se selecciona el juego. Durante el uso del bono, las apuestas realizadas en juegos excluidos del bono se considerar\xE1n inv\xE1lidas. El jugador debe conocer los t\xE9rminos y condiciones de la bonificaci\xF3n al aprovechar cualquier oferta promocional.",
  bt11: "Cada juego puede contribuir de manera diferente a las apuestas de bonificaci\xF3n. El jugador puede consultar la tabla de contribuciones en la secci\xF3n de caja de su cuenta despu\xE9s de canjear un bono para obtener m\xE1s detalles.",
  bt12: "100 %: todas las tragamonedas, Keno y tarjetas rasca y gana (los giros repetidos en las tragamonedas contribuyen con el 10 %)",
