  bt16: "0%: Baccarat, Craps, Red Dog, Sic Bo y juegos progresivos",
  bt17: "El casino no aplica bonos autom\xE1ticamente a la cuenta del jugador. Si el jugador desea reclamar un bono promocional, primero debe canjear el c\xF3digo de cup\xF3n antes de realizar un dep\xF3sito.",
  bt18: "Solo es elegible para un bono gratis antes de su primer dep\xF3sito. Todas las ganancias se anular\xE1n si se solicita m\xE1s de un bono sin realizar un dep\xF3sito.",
  bt19: "Cada bono solo se puede otorgar una vez por direcci\xF3n / computadora / direcci\xF3n IP / hogar / jugador / cuenta de acuerdo con los t\xE9rminos generales de uso. En caso de abrir varias cuentas, el casino se reserva el derecho de bloquear la cuenta y anular el saldo restante de la cuenta.",
  bt20: "Al usar el bono, las apuestas deben hacerse primero con el saldo de efectivo del jugador y luego con el bono.",
  bt21: "Los premios de juegos garantizados, puntos de compensaci\xF3n, competencias de tragamonedas, juegos de jackpot progresivo u otros eventos est\xE1n sujetos a los t\xE9rminos de bonificaci\xF3n vigentes en el momento del premio.",
  bt22: "El Casino ofrece ofertas promocionales a trav\xE9s de varios medios; sin embargo, solo el destinatario original de la oferta es elegible para usar las ofertas.",
  bt23: "Todas las ofertas de bonificaci\xF3n sin dep\xF3sito tienen un l\xEDmite m\xE1ximo de retiro. Cualquier bonificaci\xF3n o giros gratis reclamados antes del primer dep\xF3sito estar\xE1n sujetos a un l\xEDmite m\xE1ximo de retiro de $50 o equivalente en moneda y un requisito de apuesta de 70X.",
  bt24: "Todos los bonos gratuitos sin dep\xF3sito tienen un plazo de 30 d\xEDas a menos que se indique lo contrario. Si no se cumplen las condiciones de la bonificaci\xF3n dentro del plazo establecido, se cancelar\xE1 el saldo restante.",
  bt25: "Todos los juegos Network Progressive est\xE1n excluidos de todos los cupones sin dep\xF3sito (registro/giros gratis/devoluci\xF3n de dinero, etc.).",
  bt26: "Los juegos con crupier en vivo son proporcionados por Asia Gaming, BetGames.tv, eBet, Evolution, Ezugi, HollywoodTV, LiveG24, Media Live, OneTouchLive, Pragmatic Live y Vivo Gaming. Solo se puede acceder a todas las mesas con una transferencia de efectivo real disponible en la cuenta del jugador. Las condiciones generales de bonificaci\xF3n se aplican al saldo de efectivo acumulado utilizando las ofertas de bonificaci\xF3n promocionales (por ejemplo, devoluci\xF3n de efectivo, comparaci\xF3n de dep\xF3sitos, etc.). Los puntos de compensaci\xF3n no se pueden acumular durante los juegos con crupier en vivo. Las apuestas realizadas en juegos con crupier en vivo no contribuyen al requisito de apuesta.",
  bt27: "Los bonos de reembolso se basan en cada transacci\xF3n de dep\xF3sito aprobada. El jugador solo puede recibir cr\xE9dito por transacciones realizadas en las 24 horas anteriores. El jugador no es elegible para esta promoci\xF3n si se han acreditado 3 o m\xE1s bonos sin dep\xF3sito desde el \xFAltimo dep\xF3sito, o si la \xFAltima transacci\xF3n en la cuenta fue un pago exitoso. Se aplica un l\xEDmite de pago m\xE1ximo de 5X.",
  bt28: "Si un bono sin dep\xF3sito acumula ganancias y se solicita un retiro, se requiere un solo dep\xF3sito para validar la cuenta y cumplir con la solicitud.",
  bt29: "La promoci\xF3n Bonus Wheel solo est\xE1 disponible para los jugadores que han depositado y reciben un giro gratis en la rueda cada 4 horas donde pueden ganar giros gratis, efectivo gratis, bonos de dep\xF3sito gratis o 'Mejor suerte la pr\xF3xima vez' en Book of Tombs.",
  bt30: "Los jugadores de los siguientes pa\xEDses no pueden aprovechar los bonos ofrecidos: Afganist\xE1n, Aruba, Bonaire, Birmania, Congo, Curazao, Eritrea, Etiop\xEDa, Francia, Ir\xE1n, Irak, Libia, Malasia, Myanmar, Pa\xEDses Bajos, Corea del Norte, Palestina, Subotica, Singapur, Somalia, Statia, St. Maarten, Sud\xE1n, Siria, Singapur, Reino Unido, Estados Unidos, Yemen, Zimbabue.",
  bt31: "No hay un l\xEDmite m\xE1ximo de retiro de efectivo en ninguna oferta de bonificaci\xF3n de dep\xF3sito, a menos que se indique lo contrario, a excepci\xF3n de los giros gratis como se indic\xF3 anteriormente. Sin embargo, el l\xEDmite m\xE1ximo de retiro de 10 000 USD por mes s\xED se aplica seg\xFAn nuestros t\xE9rminos y condiciones.",
  bt32: "Las bonificaciones pueden rechazarse si existe sospecha de abuso de la promoci\xF3n. Todos los pagos son auditados y rechazados si se sospecha de fraude o abuso o a discreci\xF3n de la administraci\xF3n del casino.",
  bt33: "Antes de aprovechar cualquier oferta promocional, el Jugador debe verificar los detalles de su cuenta (nombre, direcci\xF3n, direcci\xF3n de correo electr\xF3nico y n\xFAmero de tel\xE9fono). Si alguna informaci\xF3n de la cuenta personal es incorrecta, la cuenta se suspender\xE1 y el saldo se perder\xE1.",
  bt34: "Todas las ofertas promocionales del casino dependen del estado, si necesita m\xE1s informaci\xF3n, comun\xEDquese con el servicio al cliente o consulte el sitio web / lobby del casino para obtener m\xE1s detalles.",
