  bt36: "Al canjear las ofertas promocionales del casino y jugar con ellas, el Jugador acepta las condiciones enumeradas anteriormente, as\xED como las condiciones de bonificaci\xF3n \xFAnicas de la oferta recibida. El Jugador no est\xE1 obligado a utilizar los bonos y no debe hacerlo si no comprende completamente los t\xE9rminos y condiciones.",
