  "PRIVACY AND SECURITY POLICY": "POL\xCDTICA DE PRIVACIDAD Y SEGURIDAD",
  psp1: "pol\xEDtica de privacidad",
  psp2: "Esta p\xE1gina est\xE1 destinada a los jugadores afectados para brindarle la seguridad de que su privacidad est\xE1 protegida y brindar informaci\xF3n completa sobre la informaci\xF3n que recopilamos y c\xF3mo la usaremos y no la usaremos. Tratamos los datos de nuestros jugadores como si fueran nuestros y nos preocupamos por garantizar el m\xE1s alto nivel de protecci\xF3n de datos personales en todo momento.",
  psp3: "1) Informaci\xF3n recopilada",
  psp4: "Durante el registro, debe proporcionar informaci\xF3n como su nombre, direcci\xF3n, n\xFAmero de tel\xE9fono y direcci\xF3n de correo electr\xF3nico. Esta informaci\xF3n es almacenada exclusivamente por nosotros en nuestros servidores seguros y nunca se comparte con terceros.",
  psp5: "Al registrarse para utilizar nuestros servicios, reconoce que ha le\xEDdo, entendido y aceptado los T\xE9rminos y condiciones de Canada777.",
  psp6: "2) Protecci\xF3n de la informaci\xF3n",
  psp7: "Canada777.com se monitorea regularmente en busca de vulnerabilidades para garantizar que su informaci\xF3n est\xE9 lo m\xE1s segura posible.",
  psp8: "Todos los datos personales se almacenan en una red segura y solo un peque\xF1o n\xFAmero de personas con las autorizaciones de seguridad adecuadas pueden acceder a ellos o modificarlos.",
  psp9: "La informaci\xF3n proporcionada ser\xE1 siempre tratada de forma estrictamente confidencial.",
  psp10: "La informaci\xF3n de pago que proporciona se codifica con tecnolog\xEDa SSL de \xFAltima generaci\xF3n para protegerlo de comportamientos en l\xEDnea maliciosos o fraudulentos.",
  psp11: "Los datos de pago no se almacenan en nuestros servidores, sino que se env\xEDan a trav\xE9s de un proveedor de puerta de enlace segura para m\xE1xima seguridad.",
  psp12: "3) Uso de la informaci\xF3n",
  psp13: "Solo usamos su informaci\xF3n personal para responder consultas o para informarle sobre informaci\xF3n sobre su cuenta, como pagos o bonificaciones disponibles.",
  psp14: "Tambi\xE9n podemos enviarle correos electr\xF3nicos regulares para informarle sobre promociones u ofertas de temporada para las que puede ser elegible y/o en las que puede estar interesado.",
  psp15: "4) Galletas",
  psp16: "Usamos cookies (si est\xE1n habilitadas por su navegador) para maximizar su experiencia mientras navega por el sitio. Esto permite que el sitio recoja y reconozca sus preferencias en funci\xF3n de sus actividades pasadas mientras juega con nosotros, esto nos permite cuando realizamos cambios en el sitio para ver qu\xE9 funciona bien y qu\xE9 no. Esto nos ayuda a mejorar la experiencia general del jugador cuando actualizamos ciertos aspectos del sitio.",
  psp17: "5) Ley CAN SPAM",
  psp18: "La Ley CAN-SPAM establece est\xE1ndares para el correo electr\xF3nico comercial, establece requisitos para los mensajes comerciales, permite a los destinatarios detener el env\xEDo de correos electr\xF3nicos e impone consecuencias estrictas por las infracciones.",
  psp19: "Para cumplir con la Ley CAN-SPAM, aceptamos:",
  psp20: "Permitimos a los usuarios darse de baja utilizando el enlace que se encuentra en la parte inferior de cada correo electr\xF3nico.",
  psp21: "Indique la direcci\xF3n f\xEDsica de nuestro negocio o ubicaci\xF3n.",
  psp22: "Verificamos la idoneidad de los servicios de marketing por correo electr\xF3nico de terceros si los usamos.",
  psp23: "No utiliza objetos o direcciones de correo electr\xF3nico falsos o enga\xF1osos.",
  psp24: "Para identificar el mensaje como publicidad de alguna manera razonable.",
  psp25: "Cumplir con las solicitudes de exclusi\xF3n/cancelaci\xF3n de suscripci\xF3n r\xE1pidamente.",
  psp26: "6) Normas de seguridad",
  psp27: "Canada777 utiliza el software m\xE1s moderno disponible para garantizar que los datos de nuestros jugadores est\xE9n siempre seguros. Contamos con un equipo de anfitriones de casino altamente capacitados para tranquilizarlo y resolver incluso los problemas m\xE1s dif\xEDciles.",
  psp28: "En el mercado de Internet en constante expansi\xF3n, confiar en los casinos en l\xEDnea puede ser una decisi\xF3n desafiante. En Canada777, nuestros valores fundamentales son la honestidad y la equidad, y auditamos de forma independiente todos nuestros juegos para asegurarnos de que todos nuestros jugadores tengan una oportunidad justa de ganar los premios mayores. Gracias a nuestro experto equipo de cajeros, podemos estar seguros de que nuestras ganancias se transferir\xE1n directamente a nuestra cuenta lo antes posible.",
  psp29: "Al implementar la \xFAltima tecnolog\xEDa de encriptaci\xF3n Secure Socket Layer (SSL) de 128 bits, Canada777 puede garantizar que sus transacciones sean siempre 100% seguras. La informaci\xF3n confidencial se transmite de forma segura a trav\xE9s de Internet a nuestro servidor seguro protegido por la \xFAltima tecnolog\xEDa de firewall.",
  psp30: "Nos enorgullecemos del soporte de nuestro casino y nuestros anfitriones est\xE1n disponibles las 24 horas del d\xEDa para que su tiempo con nosotros sea lo m\xE1s agradable posible. Nuestros anfitriones est\xE1n capacitados en todos los aspectos del casino y pueden manejar cualquier consulta de principio a fin, asegur\xE1ndose de que siempre reciba un trato eficiente y profesional.",
