  "PRIVACY AND SECURITY POLICY": "POL\xCDTICA DE PRIVACIDADE E SEGURAN\xC7A",
  psp1: "pol\xEDtica de Privacidade",
  psp2: "Esta p\xE1gina destina-se aos jogadores afetados para garantir que sua privacidade est\xE1 protegida e para fornecer informa\xE7\xF5es completas sobre as informa\xE7\xF5es que coletamos e como as usaremos ou n\xE3o. Tratamos os dados de nossos jogadores como se fossem nossos e tomamos muito cuidado para garantir o mais alto n\xEDvel de prote\xE7\xE3o de dados pessoais em todos os momentos.",
