  psp9: "As informa\xE7\xF5es fornecidas ser\xE3o sempre tratadas de forma estritamente confidencial.",
  psp10: "As informa\xE7\xF5es de pagamento que voc\xEA fornece s\xE3o criptografadas usando tecnologia SSL de \xFAltima gera\xE7\xE3o para proteg\xEA-lo de comportamentos on-line maliciosos ou fraudulentos.",
