  psp12: "3) Uso de informa\xE7\xF5es",
  psp13: "Usamos suas informa\xE7\xF5es pessoais apenas para responder a perguntas ou para inform\xE1-lo sobre informa\xE7\xF5es sobre sua conta, como pagamentos ou b\xF4nus dispon\xEDveis.",
