  psp15: "4) Biscoitos",
  psp16: "Usamos cookies (se habilitados pelo seu navegador) para maximizar sua experi\xEAncia ao navegar no site. Isso permite que o site pegue e reconhe\xE7a suas prefer\xEAncias com base em suas atividades anteriores ao jogar conosco. Isso nos permite, quando fizermos altera\xE7\xF5es no site, ver o que funciona bem e o que n\xE3o funciona. Isso nos ajuda a melhorar a experi\xEAncia geral do jogador quando atualizamos certos aspectos do site.",
