  psp26: "6) Normas de seguran\xE7a",
  psp27: "Canada777 usa o software mais moderno dispon\xEDvel para garantir que os dados de nossos jogadores estejam sempre seguros. Temos uma equipe de anfitri\xF5es de cassino altamente treinados para deix\xE1-lo tranquilo e lidar com os problemas mais dif\xEDceis.",
