  "PRIVACY AND SECURITY POLICY": "POLITIQUE DE CONFIDENTIALIT\xC9 ET DE S\xC9CURIT\xC9",
  psp1: "politique de confidentialit\xE9",
  psp2: "Cette page est destin\xE9e aux joueurs concern\xE9s pour vous donner l'assurance que votre vie priv\xE9e est prot\xE9g\xE9e et pour fournir des informations compl\xE8tes sur les informations que nous recueillons et comment nous les utiliserons et ne les utiliserons pas. Nous traitons les donn\xE9es de nos joueurs comme s'il s'agissait des n\xF4tres et nous veillons \xE0 garantir \xE0 tout moment le plus haut niveau de protection des donn\xE9es personnelles.",
  psp3: "1) Informations collect\xE9es",
  psp4: "Lors de l'inscription, vous devez fournir des informations telles que votre nom, votre adresse, votre num\xE9ro de t\xE9l\xE9phone et votre adresse e-mail. Ces informations sont stock\xE9es exclusivement par nous sur nos serveurs s\xE9curis\xE9s et ne sont jamais partag\xE9es avec des tiers.",
  psp5: "En vous inscrivant pour utiliser nos services, vous reconnaissez avoir lu, compris et accept\xE9 les conditions g\xE9n\xE9rales de Canada777.",
  psp6: "2) Protection des informations",
  psp7: "Canada777.com est r\xE9guli\xE8rement surveill\xE9 pour d\xE9tecter les vuln\xE9rabilit\xE9s afin de s'assurer que vos informations sont aussi s\xE9curis\xE9es que possible.",
  psp8: "Toutes les donn\xE9es personnelles sont stock\xE9es sur un r\xE9seau s\xE9curis\xE9 et seul un petit nombre de personnes disposant des habilitations de s\xE9curit\xE9 appropri\xE9es peuvent y acc\xE9der ou les modifier.",
  psp9: "Les informations fournies seront toujours trait\xE9es de mani\xE8re strictement confidentielle.",
  psp10: "Les informations de paiement que vous fournissez sont crypt\xE9es \xE0 l'aide de la technologie SSL de pointe pour vous prot\xE9ger contre les comportements malveillants ou frauduleux en ligne.",
  psp11: "Les donn\xE9es de paiement ne sont pas stock\xE9es sur nos serveurs, mais sont envoy\xE9es via un fournisseur de passerelle s\xE9curis\xE9e pour une s\xE9curit\xE9 maximale.",
  psp12: "3) Utilisation des informations",
  psp13: "Nous n'utilisons vos informations personnelles que pour r\xE9pondre aux demandes de renseignements ou pour vous informer des informations sur votre compte, telles que les paiements ou les bonus disponibles.",
  psp14: "Nous pouvons \xE9galement vous envoyer des e-mails r\xE9guliers pour vous informer des promotions ou offres saisonni\xE8res auxquelles vous pourriez \xEAtre \xE9ligible et/ou qui pourraient vous int\xE9resser.",
  psp15: "4) Biscuits",
