  dp0: "Einzahlungsrichtlinien",
  dp1: "Wenn Sie nach der schnellsten Einzahlungsmethode suchen, melden Sie sich einfach \xFCber unsere Website bei Ihrem Konto an und besuchen Sie die Kasse, um eine Einzahlung vorzunehmen.",
  dp2: "ALLGEMEINE GESCH\xC4FTSBEDINGUNGEN F\xDCR DIE TRANSAKTIONSVERARBEITUNG",
  dp3: "Sie stimmen zu und erkennen an, dass:",
  dp4: "Wir werden angemessene Anstrengungen unternehmen, um sicherzustellen, dass Ein- und Auszahlungen zeitnah bearbeitet werden. F\xFCr die Dauer der Bearbeitung \xFCbernehmen wir keine Gew\xE4hr.",
  dp5: "Wir k\xF6nnen nicht f\xFCr Verz\xF6gerungen in Banknetzwerken, Ausf\xE4lle des Prozessors oder Handlungen anderer Parteien, die an der Verarbeitung von Geldern beteiligt sind, verantwortlich gemacht werden, die zu Verz\xF6gerungen bei der Verarbeitung, Neubearbeitung oder R\xFCckabwicklung von Transaktionen oder der Beschlagnahme oder dem Einfrieren von Geldern f\xFChren k\xF6nnen, noch haften wir f\xFCr tats\xE4chliche oder Folgesch\xE4den, die sich aus Anspr\xFCchen wegen Verz\xF6gerung oder Beschlagnahme ergeben.",
  dp6: "Wir haften nicht f\xFCr tats\xE4chliche Sch\xE4den oder Folgesch\xE4den, die sich aus Anspr\xFCchen wegen Verz\xF6gerung oder Verlust aufgrund ung\xFCltiger, unvollst\xE4ndiger oder fehlerhafter finanzieller oder pers\xF6nlicher Daten ergeben, die der Benutzer bei seiner Einzahlungs- oder Auszahlungsanfrage angegeben hat.",
  dp7: "Im Rahmen unserer Lizenzvereinbarung und in \xDCbereinstimmung mit den Gesetzen zur Bek\xE4mpfung der Geldw\xE4sche m\xFCssen sich Benutzer dar\xFCber im Klaren sein, dass von ihnen m\xF6glicherweise die Vorlage pers\xF6nlicher Dokumente (z. B. amtlicher Ausweis, Bank- und Stromrechnungsabrechnungen, telefonische Best\xE4tigung und SOW-Dokumente) verlangt wird. auf Anfrage, damit deren \xDCbermittlung bearbeitet werden kann.",
  dp8: "Dadurch k\xF6nnen wir zum Schutz der Benutzer beitragen und verhindern, dass unsere Plattform als Vehikel f\xFCr Geldw\xE4sche oder Betrug missbraucht wird.",
  dp9: "Spielergelder und Kontoguthaben werden von uns auf getrennten Konten gef\xFChrt und nicht f\xFCr Betriebsausgaben verwendet.",
  dp10: "Diese Vereinbarung stellt sicher, dass wir unseren finanziellen Verpflichtungen gegen\xFCber unseren Online-Spielern jederzeit nachkommen k\xF6nnen und bietet eine weitere Sicherheit, dass die Gelder der Spieler bei uns immer sicher sind.",
  se0: "Selbstausschluss",
  se1: "Europa777 ist sich bewusst, dass die meisten Spieler zwar zur Unterhaltung spielen, das Spielen jedoch f\xFCr eine kleine Anzahl von Menschen sch\xE4dlich sein kann. Wir engagieren uns f\xFCr die Schaffung einer verantwortungsvollen Spielumgebung.",
  se2: "Wenn Sie \xFCber Ihr Verhalten im Spiel besorgt sind, ziehen Sie bitte eine Abmeldung in Betracht.",
  se3: "Europa777 ist bestrebt, unseren Spielern ein angenehmes und sicheres Spielerlebnis zu bieten. Wenn Sie sich f\xFCr eine Abmeldung entscheiden, wird Ihr Spielkonto bei Europa777 f\xFCr den gew\xE4hlten Zeitraum sofort abgemeldet.",
  se4: "Das bedeutet, dass Sie sich w\xE4hrend Ihres Selbstausschlusses nicht anmelden, keine Einzahlungen t\xE4tigen oder bei Europa777 spielen k\xF6nnen. Bitte beachten Sie, dass Sie Ihr Konto erst wieder er\xF6ffnen k\xF6nnen, wenn der gew\xE4hlte Selbstausschlusszeitraum abgelaufen ist.",
  se5: "Wir werden au\xDFerdem alle angemessenen Ma\xDFnahmen ergreifen, um sicherzustellen, dass Sie w\xE4hrend dieser Zeit kein Werbematerial erhalten. Wenn Sie jedoch Social-Media-Kan\xE4le nutzen, empfehlen wir Ihnen dringend, Ma\xDFnahmen zu ergreifen, um sicherzustellen, dass Sie keine Neuigkeiten oder Updates von uns erhalten.",
  se6: "Sie haben die M\xF6glichkeit, zwischen 6 Monaten und 5 Jahren abzumelden.",
  se7: "Wir empfehlen au\xDFerdem, dass Sie sich bei jedem anderen Betreiber, bei dem Sie m\xF6glicherweise registriert sind, selbst ausschlie\xDFen.",
  se8: "Um einen Selbstausschluss zu beantragen, wenden Sie sich bitte per E-Mail oder Chat an unser Support-Team. Sie k\xF6nnen auch einen Selbstausschluss von Ihrem aus eingeben",
  se9: "Mein Profil",
