  se11: "Die Kontrolle behalten",
  se12: "Wir sind uns dar\xFCber im Klaren, dass die meisten Spieler zwar zum Spa\xDF spielen, es aber auch eine kleine Anzahl von Spielern gibt, die die Kontrolle \xFCber ihr Spiel verlieren k\xF6nnten. Europa777 unterst\xFCtzt verantwortungsvolles Spielen voll und ganz. Um sicherzustellen, dass Sie weiterhin sicheres und \xFCberschaubares Spielen genie\xDFen k\xF6nnen, beachten Sie bitte Folgendes",
  se13: "Gl\xFCcksspiel sollte als Unterhaltung und nicht als Mittel zum Geldverdienen betrachtet werden",
  se14: "Behalten Sie den \xDCberblick \xFCber die Zeit und das Geld, die Sie beim Spielen ausgeben",
  se15: "Nutzen Sie Grenzen, um die Kontrolle zu behalten",
  se16: "Die folgende Liste enth\xE4lt verschiedene Ma\xDFnahmen und Tools, die Ihnen helfen sollen, den \xDCberblick \xFCber die Zeit und das Geld zu behalten, die Sie auf einer der Websites von BV Games & More verbringen",
  se17: "Einsatzlimit, um zu kontrollieren, wie viel Sie setzen",
  se18: "Einzahlungslimit, um zu begrenzen, wie viel Sie auf Ihr BV Games & More-Konto einzahlen k\xF6nnen",
  se19: "Das Verlustlimit hilft Ihnen, Ihr Budget nicht zu \xFCberschreiten",
  se20: "Maximales Einsatzlimit, um sich davor zu sch\xFCtzen, versehentlich einen h\xF6heren Spin oder Einsatz als beabsichtigt zu platzieren",
  se21: "Zeitlimit, um zu kontrollieren, dass Sie pro Spielsitzung nicht mehr Zeit als geplant verbringen",
  se22: "Realit\xE4tscheck, um Informationen \xFCber Ihr Nettoeinkommen in Ihrer aktuellen Sitzung zu erhalten",
  se23: "\u201EKonto sperren\u201C ist ein Tool, das Sie verwenden k\xF6nnen, wenn Sie eine kurze Pause von Ihrem Spiel ben\xF6tigen",
  se24: "Bevor Sie mit dem Spielen beginnen, empfehlen wir Ihnen, sich umzuschauen und unsere Limits zu nutzen.",
  se25: "Wenn Sie eine Pause vom Spiel ben\xF6tigen, k\xF6nnen Sie den Selbstausschluss im Bereich \u201EMein Konto\u201C festlegen, w\xE4hrend Sie angemeldet sind, oder indem Sie unseren Kundendienst per E-Mail oder Chat kontaktieren.",
  se26: "Wenn Sie mit jemandem \xFCber Ihre Bedenken bez\xFCglich Ihres Gl\xFCcksspiels sprechen m\xFCssen, wenden Sie sich an eine der Organisationen, die Sie unter \u201ESelbsthilfegruppen\u201C finden. Blockieren Sie den Zugriff auf Online-Gl\xFCcksspielseiten",
