  frtm0: "Fairness- und RNG-Testmethoden",
  frtm1: "Europa777 verpflichtet sich zu hohen Standards im Kundenservice und zu fairem und offenem Verhalten bei seinen Gl\xFCcksspielaktivit\xE4ten.",
  frtm2: "Das Ergebnis der Poker-, Casino- und Live-Casino-Produkte, die Europa777 seinen Kunden zur Verf\xFCgung stellt, wird durch einen zertifizierten und gepr\xFCften Zufallszahlengenerator bestimmt, der mit einem hohen Ma\xDF an Verschl\xFCsselung und Zuf\xE4lligkeit arbeitet, um ausnahmslose Fairness und keine menschliche Einmischung zu gew\xE4hrleisten (\u201ERNG\u201C).",
  frtm3: "Der RNG wird von Casino- und Live-Casino-Anbietern verwaltet und jeder von ihnen hat externe Compliance-Tests durchlaufen und diese bestanden. Dadurch wird sichergestellt, dass die Spiele, sobald sie in unsere Website integriert sind, im Hinblick auf das Benutzererlebnis die erwartete Leistung erbringen.",
  frtm4: "Der Return to Player (RTP)-Wert ist eine theoretische Berechnung der durchschnittlichen/erwarteten prozentualen Rendite des gesamten Geldeinsatzes \xFCber eine gro\xDFe Anzahl von Spielz\xFCgen (z. B. Hunderte von Millionen Spielen).",
  frtm5: "W\xE4hrend Sie in jedem einzelnen Spiel einen gro\xDFen Betrag gewinnen oder Ihren Einsatz verlieren k\xF6nnen, n\xE4hert sich der durchschnittliche Gewinn eines bestimmten Spiels, das \xFCber einen l\xE4ngeren Zeitraum gespielt wird, dem theoretischen RTP-Wert an.",
  frtm6: "Dieser theoretische Wert wird entweder \xFCber analytische Methoden (was h\xE4ufig bei nicht strategieabh\xE4ngigen Spielen wie Spielautomaten m\xF6glich ist) oder \xFCber Computersimulationen dieser komplexeren oder strategieabh\xE4ngigen Spiele (z. B. Blackjack, Roulette usw.) berechnet.",
  frtm7: "Weitere Informationen zur Fairness bestimmter Spiele finden Sie im Informationsbereich des jeweiligen Spiels. Wenn Sie diese Informationen nicht finden k\xF6nnen, wenden Sie sich bitte an unser Kundendienstteam, das Ihnen weiterhelfen wird.",
  frtm8: "Durch das Spielen von Casino-Spielen auf unserer Website erkennen Sie an und stimmen zu, dass unser RNG das Ergebnis der von Ihnen gespielten Spiele bestimmt und dass Sie die Ergebnisse aller dieser Spiele akzeptieren.",
  frtm9: "Im Falle einer Diskrepanz zwischen dem Ergebnis, das auf dem Display Ihres Ger\xE4ts und dem Spielserver angezeigt wird, hat das Ergebnis, das auf dem Spielserver angezeigt wird, Vorrang. Sie erkennen weiterhin an und stimmen zu, dass unsere Aufzeichnungen in Bezug auf etwaige Streitigkeiten, die sich aus Ihrer Spielaktivit\xE4t auf unserer Website ergeben, ma\xDFgebend sind.",
  frtm10: "F\xFCr weitere Informationen wenden Sie sich bitte an unser Kundensupport-Team",
