  "Canada777 is available to most players from around the world, unfortunately however, players from the following the following countries are restricted from registering: Afghanistan, Aruba, Bonaire, Burma, Congo, Curacao, Eritrea, Ethiopia, France, Iran, Iraq, Libya, Malaysia, Myanmar, The Netherlands, North Korea, Palestine, Saba, Singapore, Somalia, Statia, St. Maarten, Sudan, Syria, Singapore, United Kingdom, United State of America, Yemen, and Zimbabwe.": "Canada777 steht den meisten Spielern auf der ganzen Welt zur Verf\xFCgung. Spielern aus den folgenden L\xE4ndern ist die Registrierung jedoch leider untersagt: Afghanistan, Aruba, Bonaire, Burma, Kongo, Cura\xE7ao, Eritrea, \xC4thiopien, Frankreich, Iran, Irak, Libyen, Malaysia, Myanmar, Niederlande, Nordkorea, Pal\xE4stina, Saba, Singapur, Somalia, Statia, St. Maarten, Sudan, Syrien, Singapur, Vereinigtes K\xF6nigreich, Vereinigte Staaten von Amerika, Jemen und Simbabwe.",
  "Our amazing bonuses will have different terms and conditions, so read them carefully before accepting. If you have any further questions, please contact our brilliant Support Team.": "F\xFCr unsere fantastischen Boni gelten unterschiedliche Gesch\xE4ftsbedingungen. Lesen Sie diese daher sorgf\xE4ltig durch, bevor Sie sie akzeptieren. Wenn Sie weitere Fragen haben, wenden Sie sich bitte an unser hervorragendes Support-Team.",
