  "Go to the Dashboard section in the from left side menu.": "Gehen Sie im Men\xFC auf der linken Seite zum Abschnitt \u201EDashboard\u201C.",
  "Select the Deposit Tab.": "W\xE4hlen Sie die Registerkarte \u201EEinzahlung\u201C.",
