  "Make your deposit and the bonus will be added automatically.": "Machen Sie Ihre Einzahlung und der Bonus wird automatisch hinzugef\xFCgt.",
  "All our bonuses have their own terms and conditions and the wagering requirement specifies how many times the bonus funds have to be wagered before making a withdrawal. You will however see the bonus requirements below each bonus on the Promotions as well as the Bonus Terms pages.": "F\xFCr alle unsere Boni gelten eigene Gesch\xE4ftsbedingungen und die Umsatzbedingungen legen fest, wie oft das Bonusgeld umgesetzt werden muss, bevor eine Auszahlung vorgenommen werden kann. Die Bonusanforderungen finden Sie jedoch unter jedem Bonus auf den Seiten \u201EWerbeaktionen\u201C und \u201EBonusbedingungen\u201C.",
  "Welcome bonuses provide new players with bonus monies equal to a percentage of their initial deposit to welcome them to the casino and give them a taste of whats on offer.": "Willkommensbonusse bieten neuen Spielern Bonusgelder in H\xF6he eines Prozentsatzes ihrer Ersteinzahlung, um sie im Casino willkommen zu hei\xDFen und ihnen einen Vorgeschmack auf das Angebot zu geben.",
  "That is why our excellent Support Team are there for you 24/7 to assist you with anything you may need via our live chat function or email at support@europa777.com": "Aus diesem Grund ist unser hervorragendes Support-Team rund um die Uhr f\xFCr Sie da, um Sie \xFCber unsere Live-Chat-Funktion oder per E-Mail an support@europa777.com bei allen Fragen zu unterst\xFCtzen",
  "There is a minimum accepted deposit of US$ 20 or currency equivalent to make your way to winning.": "Es gibt eine akzeptierte Mindesteinzahlung von 20 US-Dollar oder den entsprechenden W\xE4hrungs\xE4quivalent, um den Weg zum Gewinn zu finden.",
  "The minimum withdrawal is US$ 50 or currency equivalent with a maximum daily (24 hour period) withdrawal limit of $10,000.": "Der Mindestauszahlungsbetrag betr\xE4gt 50 US-Dollar oder den entsprechenden W\xE4hrungs\xE4quivalent mit einem maximalen t\xE4glichen Auszahlungslimit (24-Stunden-Zeitraum) von 10.000 US-Dollar.",
  "Absolutely, all games allow you to play for real cash prizes and luck jackpots along the way. If you feel the need to practice a bit first, you can play the games in Demo.": "Auf jeden Fall k\xF6nnen Sie bei allen Spielen um echte Geldpreise und Gl\xFCcks-Jackpots spielen. Wenn Sie das Bed\xFCrfnis versp\xFCren, zun\xE4chst etwas zu \xFCben, k\xF6nnen Sie die Spiele in der Demoversion spielen.",
  "The following deposit and withdrawal methods are available at Europa777: Interac, Flexepin, Visa, MasterCard, Crypto Wallet: BTC, LTC, ETH, TRX (Tron), BNB (Binance coin), BUSB (Binance USD).": "Folgende Ein- und Auszahlungsmethoden stehen bei Europa777 zur Verf\xFCgung: Interac, Flexepin, Visa, MasterCard, Crypto Wallet: BTC, LTC, ETH, TRX (Tron), BNB (Binance Coin), BUSB (Binance USD).",
  "BONUS TERMS": "BONUSBEDINGUNGEN",
  "BONUS CONDITIONS": "BONUSBEDINGUNGEN",
  bt1: "Der Spieler ist daf\xFCr verantwortlich, die Bonusbedingungen zu pr\xFCfen und zu verstehen, bevor er an einem Bonus-Werbeangebot teilnimmt (kostenlose Chips, Einzahlungsvereinbarung, Comp-Punkte, Cashback, Manager-Boni usw.). Durch die Einl\xF6sung eines Bonus akzeptiert der Spieler die unten aufgef\xFChrten Bonusbedingungen.",
