  bt8: "Die maximale Auszahlung f\xFCr Freispiele betr\xE4gt 50 $ oder den Gegenwert in einer anderen W\xE4hrung. Stellen Sie sicher, dass Sie \xFCber ausreichende Mittel verf\xFCgen, bevor Sie eine Auszahlung beantragen. Wenn Sie eine Auszahlung beantragen, wird der Bonusbetrag automatisch abgezogen.",
