  bt10: "Die Wette muss bei Auswahl des Spiels platziert werden. W\xE4hrend der Nutzung des Bonus gelten Wetten auf Spiele, die vom Bonus ausgeschlossen sind, als ung\xFCltig. Der Spieler muss die Bonusbedingungen kennen, wenn er ein Werbeangebot in Anspruch nehmen m\xF6chte.",
