  bt17: "Das Casino wendet Boni nicht automatisch auf das Konto des Spielers an. Wenn der Spieler einen Aktionsbonus beanspruchen m\xF6chte, muss er zun\xE4chst den Gutscheincode einl\xF6sen, bevor er eine Einzahlung t\xE4tigen kann.",
  bt18: "Vor Ihrer ersten Einzahlung haben Sie nur Anspruch auf einen Gratisbonus. Alle Gewinne werden f\xFCr ung\xFCltig erkl\xE4rt, wenn mehr als ein Bonus ohne eine Einzahlung in Anspruch genommen wird.",
  bt19: "Jeder Bonus kann gem\xE4\xDF den Allgemeinen Nutzungsbedingungen nur einmal pro Adresse / Computer / IP-Adresse / Haushalt / Spieler / Konto gew\xE4hrt werden. Im Falle der Er\xF6ffnung mehrerer Konten beh\xE4lt sich das Casino das Recht vor, das Konto zu sperren und den verbleibenden Kontostand f\xFCr ung\xFCltig zu erkl\xE4ren.",
  bt20: "Bei der Nutzung des Bonus m\xFCssen Wetten zun\xE4chst mit dem Barguthaben des Spielers und dann mit dem Bonus get\xE4tigt werden.",
  bt21: "Preise aus Spielen mit Feature-Garantie, Kompensationspunkten, Slot-Wettbewerben, progressiven Jackpot-Spielen oder anderen Veranstaltungen unterliegen den Bonusbedingungen, die zum Zeitpunkt des Preises gelten.",
  bt22: "Das Casino bietet Werbeangebote \xFCber eine Reihe von Medien an; Zur Nutzung der Angebote ist jedoch nur der urspr\xFCngliche Angebotsempf\xE4nger berechtigt.",
  bt23: "F\xFCr alle Bonusangebote ohne Einzahlung gilt ein maximales Auszahlungslimit. Alle Boni oder Freispiele, die vor der ersten Einzahlung in Anspruch genommen werden, unterliegen einem maximalen Auszahlungslimit von 50 $ oder dem Gegenwert in einer anderen W\xE4hrung und einer 70-fachen Wettanforderung.",
  bt24: "Alle kostenlosen Boni ohne Einzahlung haben einen Zeitrahmen von 30 Tagen, sofern nicht anders angegeben. Werden die Bonusbedingungen nicht innerhalb des vorgegebenen Zeitraums erf\xFCllt, wird das Restguthaben annulliert.",
  bt25: "Alle Network Progressive-Spiele sind von allen Gutscheinen ohne Einzahlung (Registrierung / Freispiele / Cashback usw.) ausgeschlossen.",
  bt26: "Live-Dealer-Spiele werden von Asia Gaming, BetGames.tv, eBet, Evolution, Ezugi, HollywoodTV, LiveG24, Media Live, OneTouchLive, Pragmatic Live und Vivo Gaming angeboten. Der Zugriff auf alle Tische ist nur mit einer Echtgeld\xFCberweisung auf dem Konto des Spielers m\xF6glich. F\xFCr das durch Aktionsbonusangebote (z. B. Cashback, Einzahlungsvergleich etc.) angesammelte Bargeldguthaben gelten die allgemeinen Bonusbedingungen. Bei Live-Dealer-Spielen k\xF6nnen keine Kompensationspunkte gesammelt werden. Wetten, die auf Live-Dealer-Spiele platziert werden, tragen nicht zu den Wettanforderungen bei.",
  bt27: "Cashback-Boni basieren auf jeder genehmigten Einzahlungstransaktion. Der Spieler kann nur eine Gutschrift f\xFCr Transaktionen erhalten, die in den letzten 24 Stunden get\xE4tigt wurden. Der Spieler hat keinen Anspruch auf diese Aktion, wenn seit der letzten Einzahlung 3 oder mehr Boni ohne Einzahlung gutgeschrieben wurden oder wenn die letzte Transaktion auf dem Konto eine erfolgreiche Auszahlung war. Es gilt das 5-fache maximale Auszahlungslimit.",
  bt28: "Wenn ein Bonus ohne Einzahlung Gewinne ansammelt und eine Auszahlung beantragt wird, ist eine einzige Einzahlung erforderlich, um das Konto zu validieren und die Anfrage zu erf\xFCllen.",
  bt29: "Die Aktion \u201EBonusrad\u201C steht nur Spielern zur Verf\xFCgung, die eingezahlt haben und alle 4 Stunden eine Freidrehung am Rad erhalten, bei der sie entweder Freispiele, Gratisgeld, Gratis-Einzahlungsboni oder \u201EMehr Gl\xFCck beim n\xE4chsten Mal\u201C bei Book of Tombs gewinnen k\xF6nnen.",
  bt30: "Spieler aus folgenden L\xE4ndern k\xF6nnen die angebotenen Boni nicht nutzen: Afghanistan, Aruba, Bonaire, Burma, Kongo, Cura\xE7ao, Eritrea, \xC4thiopien, Frankreich, Iran, Irak, Libyen, Malaysia, Myanmar, Niederlande, Nordkorea, Pal\xE4stina, Subotica, Singapur, Somalia, Statia, St. Maarten, Sudan, Syrien, Singapur, Vereinigtes K\xF6nigreich, Vereinigte Staaten, Jemen, Simbabwe.",
  bt31: "Es gibt kein maximales Auszahlungslimit f\xFCr Einzahlungsbonusangebote, sofern nicht anders angegeben, mit Ausnahme der oben genannten Freispiele. Gem\xE4\xDF unseren Allgemeinen Gesch\xE4ftsbedingungen gilt jedoch das maximale Auszahlungslimit von 10.000 USD pro Monat",
  bt32: "Boni k\xF6nnen abgelehnt werden, wenn der Verdacht eines Missbrauchs der Aktion besteht. Alle Auszahlungen werden gepr\xFCft und bei Verdacht auf Betrug oder Missbrauch oder nach Ermessen des Casino-Managements abgelehnt.",
  bt33: "Bevor der Spieler ein Werbeangebot in Anspruch nimmt, muss er seine Kontodaten (Name, Adresse, E-Mail-Adresse und Telefonnummer) noch einmal \xFCberpr\xFCfen. Wenn pers\xF6nliche Kontoinformationen falsch sind, wird das Konto gesperrt und das Guthaben verf\xE4llt.",
  bt34: "Alle Casino-Werbeangebote sind statusabh\xE4ngig. Wenn Sie weitere Informationen ben\xF6tigen, wenden Sie sich bitte an den Kundendienst oder schauen Sie auf der Website/Casino-Lobby nach, um weitere Informationen zu erhalten.",
  bt35: "Das Casino hat das Recht, jede Aktion oder die Bedingungen der Angebote ohne vorherige Ank\xFCndigung zu \xE4ndern/modifizieren/zu beenden. Es liegt in der Verantwortung des Spielers, die Allgemeinen Gesch\xE4ftsbedingungen und die in Werbe-E-Mails enthaltenen Regeln regelm\xE4\xDFig zu \xFCberpr\xFCfen.",
  bt36: "Durch die Einl\xF6sung der Werbeangebote des Casinos und das Spielen mit ihnen akzeptiert der Spieler die oben aufgef\xFChrten Bedingungen sowie die einzigartigen Bonusbedingungen des erhaltenen Angebots. Der Spieler ist nicht verpflichtet, die Boni zu nutzen und sollte dies auch nicht tun, wenn er die Allgemeinen Gesch\xE4ftsbedingungen nicht vollst\xE4ndig versteht.",
  bt37: "Wenn der Bonus versehentlich beansprucht wurde, kann der Spieler den Bonuscode \xFCber den Checkout-Bereich des Kontos l\xF6schen oder sich an den Kundendienst wenden.",
  bt38: "Bonuscodes k\xF6nnen jeweils nur einzeln verwendet werden.",
  bt39: "Das Casino arbeitet f\xFCr alle Boni in der Eastern Time (EST), um die Konsistenz f\xFCr alle Spieler weltweit zu gew\xE4hrleisten.",
  bt40: "Ihr spielbares Guthaben muss unter 1 $ liegen, bevor Ihrem Konto ein Bonus oder eine Einzahlung gutgeschrieben wird. Andernfalls k\xF6nnen Auszahlungen oder maximale Auszahlungslimits beeintr\xE4chtigt werden.",
  bt41: "Kostenlose Boni werden dem Konto nicht gutgeschrieben, w\xE4hrend das Casino-Konto ausgezahlt wird.",
  bt42: "Canada777 beh\xE4lt sich das Recht vor, die oben genannten Allgemeinen Gesch\xE4ftsbedingungen bei Bedarf zu \xE4ndern, zu erg\xE4nzen oder zu entfernen. Wir empfehlen Ihnen, eine Kopie dieser Seite zu speichern oder sie auszudrucken und an einem sicheren Ort aufzubewahren.",
  bt43: "Kostenlose Boni werden dem Konto nicht gutgeschrieben, w\xE4hrend das Casino-Konto ausgezahlt wird.",
  bt44: "Canada777 beh\xE4lt sich das Recht vor, die oben genannten Bedingungen bei Bedarf zu erg\xE4nzen/zu \xE4ndern, hinzuzuf\xFCgen oder zu entfernen. Wir empfehlen, die Kopie dieser Seite aufzubewahren oder auszudrucken und an einem sicheren Ort aufzubewahren",
  bt45: "Sowohl der Bonus als auch die Gewinne werden entfernt, sobald der Bonus abl\xE4uft.",
