  bt52: "Wenn das Casino Ihrem Spielerkonto versehentlich einen Bonus oder Gewinne gutschreibt, die Ihnen nicht geh\xF6ren, sei es aufgrund eines technischen Problems, eines Fehlers in den Auszahlungstabellen, eines menschlichen Versagens oder aus anderen Gr\xFCnden, bleiben der Betrag und/oder die Gewinne aus diesem Bonus erhalten Eigentum des Casinos und wird von Ihrem Spielerkonto abgebucht. Wenn Sie Gelder abgehoben haben, die Ihnen nicht geh\xF6ren, bevor wir von dem Fehler Kenntnis erlangt haben, stellt der f\xE4lschlicherweise gezahlte Betrag (unbeschadet anderer Rechtsbehelfe und Ma\xDFnahmen, die m\xF6glicherweise gesetzlich zur Verf\xFCgung stehen) eine Schuld dar, die Sie uns gegen\xFCber schulden. Im Falle einer fehlerhaften Gutschrift sind Sie verpflichtet, uns dies unverz\xFCglich per E-Mail mitzuteilen.",
