  "PRIVACY AND SECURITY POLICY": "DATENSCHUTZ- UND SICHERHEITSRICHTLINIEN",
  psp1: "Datenschutz-Bestimmungen",
  psp2: "Diese Seite ist f\xFCr betroffene Spieler gedacht, um Ihnen die Gewissheit zu geben, dass Ihre Privatsph\xE4re gesch\xFCtzt ist, und um vollst\xE4ndige Informationen dar\xFCber bereitzustellen, welche Informationen wir sammeln und wie wir sie verwenden und wie nicht. Wir behandeln die Daten unserer Spieler so, als w\xE4ren es unsere eigenen und legen gro\xDFen Wert darauf, jederzeit ein H\xF6chstma\xDF an Schutz personenbezogener Daten zu gew\xE4hrleisten.",
  psp3: "1) Gesammelte Informationen",
  psp4: "Bei der Registrierung m\xFCssen Sie Angaben wie Ihren Namen, Ihre Adresse, Telefonnummer und E-Mail-Adresse machen. Diese Informationen werden ausschlie\xDFlich von uns auf unseren sicheren Servern gespeichert und niemals an Dritte weitergegeben.",
  psp5: "Indem Sie sich f\xFCr die Nutzung unserer Dienste registrieren, best\xE4tigen Sie, dass Sie die Allgemeinen Gesch\xE4ftsbedingungen von Canada777 gelesen, verstanden und akzeptiert haben.",
  psp6: "2) Schutz von Informationen",
  psp7: "Canada777.com wird regelm\xE4\xDFig auf Schwachstellen \xFCberpr\xFCft, um sicherzustellen, dass Ihre Daten so sicher wie m\xF6glich sind.",
  psp8: "Alle personenbezogenen Daten werden in einem sicheren Netzwerk gespeichert und nur eine kleine Anzahl von Personen mit entsprechenden Sicherheitsfreigaben k\xF6nnen darauf zugreifen oder sie \xE4ndern.",
  psp9: "Die bereitgestellten Informationen werden stets streng vertraulich behandelt.",
  psp10: "Die von Ihnen angegebenen Zahlungsinformationen werden mit modernster SSL-Technologie verschl\xFCsselt, um Sie vor b\xF6swilligem oder betr\xFCgerischem Online-Verhalten zu sch\xFCtzen.",
  psp11: "Zahlungsdaten werden nicht auf unseren Servern gespeichert, sondern f\xFCr maximale Sicherheit \xFCber einen sicheren Gateway-Anbieter gesendet.",
  psp12: "3) Nutzung von Informationen",
  psp13: "Wir verwenden Ihre pers\xF6nlichen Daten nur, um auf Anfragen zu antworten oder Sie \xFCber Informationen zu Ihrem Konto zu informieren, beispielsweise \xFCber verf\xFCgbare Auszahlungen oder Boni.",
  psp14: "M\xF6glicherweise senden wir Ihnen auch regelm\xE4\xDFig E-Mails, um Sie \xFCber saisonale Werbeaktionen oder Angebote zu informieren, f\xFCr die Sie m\xF6glicherweise berechtigt sind und/oder an denen Sie interessiert sein k\xF6nnten.",
  psp15: "4) Cookies",
  psp16: "Wir verwenden Cookies (sofern von Ihrem Browser aktiviert), um Ihr Erlebnis beim Navigieren auf der Website zu maximieren. Dies erm\xF6glicht es der Website, Ihre Pr\xE4ferenzen basierend auf Ihren bisherigen Aktivit\xE4ten beim Spielen mit uns zu erfassen und zu erkennen. Dies erm\xF6glicht es uns, bei \xC4nderungen an der Website zu sehen, was gut funktioniert und was nicht. Dies hilft uns, das Spielerlebnis insgesamt zu verbessern, wenn wir bestimmte Aspekte der Website aktualisieren.",
  psp17: "5) CAN-SPAM-Gesetz",
  psp18: "Das CAN-SPAM-Gesetz legt Standards f\xFCr kommerzielle E-Mails fest, legt Anforderungen f\xFCr kommerzielle Nachrichten fest, erm\xF6glicht es Empf\xE4ngern, den Versand von E-Mails an sie zu stoppen, und sieht strenge Konsequenzen f\xFCr Verst\xF6\xDFe vor.",
  psp19: "Zur Einhaltung des CAN-SPAM-Gesetzes erkl\xE4ren wir uns mit Folgendem einverstanden:",
  psp20: "Wir erm\xF6glichen Benutzern die Abmeldung \xFCber den Link am Ende jeder E-Mail.",
  psp21: "Geben Sie die physische Adresse unseres Unternehmens oder Standorts an.",
  psp22: "Sofern wir diese nutzen, pr\xFCfen wir die Eignung der E-Mail-Marketing-Dienste Dritter.",
  psp23: "Sie verwenden keine falschen oder irref\xFChrenden Angaben oder E-Mail-Adressen.",
  psp24: "Um die Nachricht auf sinnvolle Weise als Werbung zu kennzeichnen.",
  psp25: "Erf\xFCllen Sie Abmelde-/Abmeldeanfragen schnell.",
  psp26: "6) Sicherheitsvorschriften",
  psp27: "Canada777 verwendet die modernste verf\xFCgbare Software, um sicherzustellen, dass die Daten unserer Spieler immer sicher sind. Wir verf\xFCgen \xFCber ein Team hochqualifizierter Casino-Gastgeber, die Sie beruhigen und selbst die schwierigsten Probleme l\xF6sen k\xF6nnen.",
  psp28: "Im st\xE4ndig wachsenden Internetmarkt kann es eine schwierige Entscheidung sein, Online-Casinos zu vertrauen. Bei Canada777 sind Ehrlichkeit und Fairness unsere Grundwerte und wir pr\xFCfen alle unsere Spiele unabh\xE4ngig, um sicherzustellen, dass alle unsere Spieler eine faire Chance auf den Gewinn der Jackpots haben. Dank unseres fachkundigen Kassiererteams k\xF6nnen wir sicher sein, dass unsere Gewinne so schnell wie m\xF6glich direkt auf unser Konto \xFCberwiesen werden.",
  psp29: "Durch die Implementierung der neuesten 128-Bit-SSL-Verschl\xFCsselungstechnologie (Secure Socket Layer) kann Canada777 sicherstellen, dass Ihre Transaktionen immer 100 % sicher sind. Sensible Informationen werden sicher \xFCber das Internet an unseren sicheren Server \xFCbertragen, der durch die neueste Firewall-Technologie gesch\xFCtzt ist.",
  psp30: "Wir sind stolz auf unseren Casino-Support und unsere Gastgeber stehen Ihnen rund um die Uhr zur Verf\xFCgung, um Ihre Zeit bei uns so angenehm wie m\xF6glich zu gestalten. Unsere Gastgeber sind in allen Aspekten des Casinos geschult und k\xF6nnen jede Anfrage von Anfang bis Ende bearbeiten und sicherstellen, dass Sie stets effizient und professionell behandelt werden.",
  "RESPONSIBLE GAMBLING": "VERANTWORTUNGSBEWUSSTES SPIELEN",
  rg1: "Canada777 setzt sich f\xFCr verantwortungsvolles Spielen ein und wir unternehmen stets die notwendigen Schritte, um sicherzustellen, dass wir alle unsere Spieler in dieser Hinsicht voll und ganz unterst\xFCtzen.",
  rg2: "Wir stellen sicher, dass die von uns angebotenen Spiele allen Freude bereiten, die spielen m\xF6chten, aber wir wissen, dass wir eine Verantwortung gegen\xFCber allen unseren Spielern haben.",
  rg3: "Obwohl wir verstehen, dass Online-Gaming f\xFCr viele Menschen ein Hobby und gro\xDFer Spa\xDF ist, kann das Gl\xFCcksspiel dazu f\xFChren, dass einige Spieler s\xFCchtig werden und daher unsere Dienste nutzen, um ihre Sucht zu stillen.",
  rg4: "Um sicherzustellen, dass Sie verantwortungsbewusst spielen, haben wir einige Richtlinien vorgeschlagen, die Sie befolgen sollten:",
  rg5: "Verantwortungsvolles Gl\xFCcksspiel",
  rg6: "1. Spielen Sie nicht, wenn Sie sich von einer Sucht erholen oder unter dem Einfluss der folgenden Substanzen stehen",
  rg7: "unter dem Einfluss von Alkohol oder einer anderen Substanz.",
  rg8: "2. Geben Sie sich eine bestimmte Zeit zum Spielen und beschr\xE4nken Sie sich auf diese Zeit, unabh\xE4ngig davon, ob Sie gewinnen oder verlieren.",
  rg9: "3. Verlassen Sie sich nicht auf das Gl\xFCcksspiel als Einnahmequelle oder um Verluste zu verkraften.",
  rg10: "4. Lassen Sie nicht zu, dass das Gl\xFCcksspiel andere Aspekte Ihres t\xE4glichen Lebens beeintr\xE4chtigt.",
  rg11: "5. Setzen Sie sich im Rahmen Ihrer M\xF6glichkeiten Grenzen, sowohl f\xFCr K\xE4ufe als auch f\xFCr Verluste, bevor Sie beginnen.",
  rg12: "Wenn Sie zu irgendeinem Zeitpunkt das Gef\xFChl haben, dass Ihr Gl\xFCcksspiel unverantwortlich wird, stehen Ihnen unsere Casino-Gastgeber mit vielen Optionen zur Verf\xFCgung, um Ihnen zu helfen und Sie mit Profis in Kontakt zu bringen oder Sie in die richtige Richtung zu weisen, wenn Sie weitere Unterst\xFCtzung ben\xF6tigen. Sie k\xF6nnen uns bitten, Folgendes auf unserer Website zu ersetzen:",
  rg13: "a) Einzahlungslimits \u2013 Wir k\xF6nnen Ihnen helfen, indem wir Ihnen t\xE4gliche, w\xF6chentliche oder sogar monatliche Limits festlegen, um dies sicherzustellen",
  rg14: "Damit Sie die ausgegebenen Betr\xE4ge kontrollieren k\xF6nnen, k\xF6nnen wir dies auf Anfrage tun.",
