  frtm3: "RNG jest administrowane przez dostawc\xF3w kasyn i kasyn na \u017Cywo, a ka\u017Cdy z nich przeszed\u0142 zewn\u0119trzne testy zgodno\u015Bci. Gwarantuje to, \u017Ce gry po zintegrowaniu z nasz\u0105 witryn\u0105 b\u0119d\u0105 dzia\u0142a\u0142y zgodnie z oczekiwaniami pod wzgl\u0119dem do\u015Bwiadczenia u\u017Cytkownika.",
  frtm4: "Warto\u015B\u0107 zwrotu dla gracza (RTP) jest teoretycznym obliczeniem \u015Bredniego/oczekiwanego procentowego zwrotu z ca\u0142kowitej kwoty zak\u0142adu w du\u017Cej liczbie gier (np. setkach milion\xF3w gier).",
  frtm5: "Chocia\u017C mo\u017Cesz wygra\u0107 du\u017C\u0105 kwot\u0119 lub przegra\u0107 zak\u0142ad w dowolnej pojedynczej rozgrywce, \u015Bredni zwrot z okre\u015Blonej gry rozgrywanej przez d\u0142ugi czas zbli\u017Cy si\u0119 do teoretycznej warto\u015Bci RTP.",
  frtm6: "Ta teoretyczna warto\u015B\u0107 jest obliczana albo za pomoc\u0105 metod analitycznych (co cz\u0119sto jest mo\u017Cliwe w przypadku gier niezwi\u0105zanych ze strategi\u0105, takich jak automaty), albo za pomoc\u0105 symulacji komputerowych tych bardziej z\u0142o\u017Conych lub zale\u017Cnych od strategii gier (np. Blackjack, ruletka itp.)",
  frtm7: "Aby uzyska\u0107 wi\u0119cej informacji na temat uczciwo\u015Bci okre\u015Blonych gier, odwied\u017A sekcj\u0119 informacyjn\u0105 odpowiedniej gry. Je\u015Bli nie mo\u017Cesz znale\u017A\u0107 tych informacji, skontaktuj si\u0119 z naszym zespo\u0142em obs\u0142ugi klienta, kt\xF3ry udzieli Ci dalszej pomocy.",
  frtm8: "Graj\u0105c w gry kasynowe na naszej stronie, potwierdzasz i zgadzasz si\u0119, \u017Ce nasze RNG b\u0119d\u0105 decydowa\u0107 o wyniku gier, w kt\xF3re grasz, i \u017Ce zaakceptujesz wyniki wszystkich takich gier.",
  frtm9: "W przypadku rozbie\u017Cno\u015Bci mi\u0119dzy wynikiem, kt\xF3ry pojawia si\u0119 na wy\u015Bwietlaczu Twojego urz\u0105dzenia, a serwerem gry, rozstrzygaj\u0105cy jest wynik, kt\xF3ry pojawia si\u0119 na serwerze gry. Ponadto potwierdzasz i zgadzasz si\u0119, \u017Ce nasze zapisy b\u0119d\u0105 rozstrzygaj\u0105ce w odniesieniu do wszelkich spor\xF3w wynikaj\u0105cych z Twojej aktywno\u015Bci w grach na naszej stronie internetowej.",
