  psp18: "Ustawa CAN-SPAM okre\u015Bla standardy dla komercyjnych wiadomo\u015Bci e-mail, wymagania dotycz\u0105ce wiadomo\u015Bci komercyjnych, umo\u017Cliwia odbiorcom zaprzestanie wysy\u0142ania do nich wiadomo\u015Bci e-mail oraz nak\u0142ada surowe konsekwencje za naruszenia.",
