  tc146: "Wszelkie spory, kt\xF3re mog\u0105 powsta\u0107 mi\u0119dzy Tob\u0105 a Kasynem, w tym ich nast\u0119pcami prawnymi na podstawie tytu\u0142u og\xF3lnego lub specjalnego w wyniku niniejszych Warunk\xF3w lub w wyniku dalszych um\xF3w i innych dzia\u0142a\u0144 zwi\u0105zanych z niniejszymi Warunkami, b\u0119d\u0105 rozstrzygane wy\u0142\u0105cznie przez arbitra\u017Cu na Cyprze i zgodnie z cypryjskimi przepisami post\u0119powania cywilnego.",
  tc147: "21. NIEMO\u017BLIWO\u015A\u0106 PRZENOSZENIA",
  tc148: "Gracz nie mo\u017Ce cedowa\u0107, zastawia\u0107 ani przenosi\u0107 w\u0142asno\u015Bci jakichkolwiek roszcze\u0144 wobec Kasyna wynikaj\u0105cych z niniejszych Warunk\xF3w, korzystania z Witryny lub udzia\u0142u Gracza w Grach bez uprzedniej pisemnej zgody Kasyna.",
  tc149: "Zakaz ten opiera si\u0119 na art. 83 ust. 2 ksi\u0119gi 3 Kodeksu Cywilnego i zabrania przenoszenia jakichkolwiek warto\u015Bciowych aktyw\xF3w jakiegokolwiek rodzaju, w tym mi\u0119dzy innymi w\u0142asno\u015Bci kont, wygranych, depozyt\xF3w, zak\u0142ad\xF3w, praw i/lub roszcze\u0144 zwi\u0105zanych z tymi aktywami, zar\xF3wno prawnych, handlowych, jak i innych.",
  tc150: "Ograniczenie okre\u015Blonych transfer\xF3w obejmuje r\xF3wnie\u017C, ale nie wy\u0142\u0105cznie, obci\u0105\u017Canie, zastaw, cesj\u0119, u\u017Cytkowanie, handel, po\u015Brednictwo, hipotek\u0119 i/lub darowizny w jakimkolwiek kszta\u0142cie lub formie we wsp\xF3\u0142pracy z powiernikiem lub jak\u0105kolwiek inn\u0105 stron\u0105 trzeci\u0105, firm\u0105 , osoba fizyczna lub prawna, podmiot."
