  kap25: "A questo proposito, questa politica stabilisce i passi specifici che Europa777 adotter\xE0 per garantire che la sua condotta sia allineata con l'approccio basato sul rischio per quanto riguarda la considerazione e l'identificazione dei rischi che incidono direttamente sul riciclaggio di denaro e sul finanziamento del terrorismo.",
  kap26: "2.2 Valutazione del rischio",
