  "In the case of detection of the cashback bonus rules abuse or failure to comply with the wagering requirements specified in paragraph 8 of these rules, the Casino may cancel and seize all winnings gained with an active cashback bonus, as well as to confiscate an amount equal to the amount of cashback bonus received.": "In caso di rilevamento dell'abuso delle regole del bonus cashback o del mancato rispetto dei requisiti di scommessa specificati nel paragrafo 8 di queste regole, il Casin\xF2 pu\xF2 annullare e sequestrare tutte le vincite ottenute con un bonus cashback attivo, nonch\xE9 confiscare un importo pari a all'importo del bonus cashback ricevuto.",
