  "Canada777 is available to most players from around the world, unfortunately however, players from the following the following countries are restricted from registering: Afghanistan, Aruba, Bonaire, Burma, Congo, Curacao, Eritrea, Ethiopia, France, Iran, Iraq, Libya, Malaysia, Myanmar, The Netherlands, North Korea, Palestine, Saba, Singapore, Somalia, Statia, St. Maarten, Sudan, Syria, Singapore, United Kingdom, United State of America, Yemen, and Zimbabwe.": "Canada777 \xE8 disponibile per la maggior parte dei giocatori di tutto il mondo, purtroppo per\xF2 ai giocatori dei seguenti paesi \xE8 vietato registrarsi: Afghanistan, Aruba, Bonaire, Birmania, Congo, Curacao, Eritrea, Etiopia, Francia, Iran, Iraq, Libia, Malesia, Myanmar, Paesi Bassi, Corea del Nord, Palestina, Saba, Singapore, Somalia, Statia, St. Maarten, Sudan, Siria, Singapore, Regno Unito, Stati Uniti d'America, Yemen e Zimbabwe.",
