  psp4: "Teschi in alto!",
  psp5: "Registrandoti per utilizzare i nostri servizi, riconosci di aver letto, compreso e accettato i Termini e condizioni di Canada777.",
  psp6: "2) Protezione delle informazioni",
  psp7: "Canada777.com viene regolarmente monitorato per le vulnerabilit\xE0 per garantire che le tue informazioni siano il pi\xF9 sicure possibile.",
