  psp17: "5) Legge CAN SPAM",
  psp18: "Il CAN-SPAM Act stabilisce gli standard per la posta elettronica commerciale, stabilisce i requisiti per i messaggi commerciali, consente ai destinatari di interrompere l'invio di e-mail e impone severe conseguenze per le violazioni.",
  psp19: "Al fine di rispettare la legge CAN-SPAM, accettiamo di:",
  psp20: "Consentiamo agli utenti di annullare l'iscrizione utilizzando il collegamento in fondo a ogni e-mail.",
  psp21: "Elenca l'indirizzo fisico della nostra attivit\xE0 o sede.",
  psp22: "Verifichiamo l'idoneit\xE0 dei servizi di email marketing di terze parti se li utilizziamo.",
  psp23: "Non utilizzi oggetti o indirizzi email falsi o fuorvianti.",
  psp24: "Identificare il messaggio come pubblicit\xE0 in qualche modo ragionevole.",
  psp25: "Soddisfa rapidamente le richieste di disattivazione/annullamento dell'iscrizione.",
  psp26: "6) Norme di sicurezza",
  psp27: "Canada777 utilizza il software pi\xF9 moderno disponibile per garantire che i dati dei nostri giocatori siano sempre al sicuro. Abbiamo un team di host di casin\xF2 altamente qualificati per tranquillizzarti e affrontare anche i problemi pi\xF9 difficili.",
  psp28: "Nel mercato Internet in continua espansione, fidarsi dei casin\xF2 online pu\xF2 essere una decisione impegnativa. In Canada777, i nostri valori fondamentali sono l'onest\xE0 e la correttezza e controlliamo in modo indipendente tutti i nostri giochi per garantire che tutti i nostri giocatori abbiano una buona possibilit\xE0 di vincere i jackpot. Grazie al nostro esperto team di cassieri, possiamo essere sicuri che le nostre vincite vengano trasferite direttamente sul nostro conto il prima possibile.",
  psp29: "Implementando la pi\xF9 recente tecnologia di crittografia SSL (Secure Socket Layer) a 128 bit, Canada777 pu\xF2 garantire che le tue transazioni siano sempre sicure al 100%. Le informazioni sensibili vengono trasmesse in modo sicuro su Internet al nostro server sicuro protetto dalla pi\xF9 recente tecnologia firewall.",
  psp30: "Siamo orgogliosi del nostro supporto al casin\xF2 e i nostri host sono disponibili 24 ore al giorno per rendere il tuo tempo con noi il pi\xF9 piacevole possibile. I nostri host sono addestrati in tutti gli aspetti del casin\xF2 e possono gestire qualsiasi richiesta dall'inizio alla fine, assicurandoti di essere sempre trattato in modo efficiente e professionale.",
  "RESPONSIBLE GAMBLING": "GIOCO RESPONSABILE",
  rg1: "Canada777 si impegna per un gioco responsabile e adottiamo sempre le misure necessarie per garantire il pieno supporto a tutti i nostri giocatori in questo senso.",
