  rg9: "3. Non fare affidamento sul gioco d'azzardo come fonte di reddito o per inseguire le tue perdite.",
  rg10: "4. Non lasciare che il gioco d'azzardo interferisca con altri aspetti della tua vita quotidiana.",
  rg11: "5. Stabilisci dei limiti entro i tuoi mezzi, sia per l'acquisto che per le perdite, prima di iniziare.",
  rg12: "Se in qualsiasi momento ritieni che il tuo gioco d'azzardo stia diventando irresponsabile, i nostri host di casin\xF2 hanno molte opzioni disponibili per assisterti e metterti in contatto con professionisti o indirizzarti nella giusta direzione per ulteriore assistenza. Puoi chiederci di sostituire quanto segue sul nostro sito:",
  rg13: "a) Limiti di deposito - Possiamo aiutarti impostando limiti giornalieri, settimanali o persino mensili per assicurarti che ci\xF2 avvenga",
  rg14: "in modo che tu possa controllare gli importi spesi, possiamo farlo su richiesta.",
  rg15: "e pu\xF2 anche essere richiesto per un determinato periodo di tempo, dopo il quale possiamo tornare alla revisione se lo desideri.",
  rg16: "b) Periodo di riflessione - Fai una pausa sul tuo account; forse hai avuto una brutta svolta e hai bisogno di una pausa;",
  rg17: "c) Autoesclusione - Se hai provato tutte le altre alternative, ma non ti senti ancora in controllo della situazione,",
  rg18: "l'autoesclusione potrebbe essere l'opzione migliore per te. Per fare questo, parla con uno degli host del casin\xF2 che sar\xE0 felice di prendere accordi per te.",
