  tc37: "I giocatori dei seguenti paesi non possono vincere alcun jackpot dai giochi con jackpot offerti da NetEnt (come, a titolo esemplificativo, Mega Fortune): Australia, Azerbaigian, Cina, Danimarca, India, Israele, Italia, Giappone, Malesia, Qatar, Russia , Spagna, Tailandia, Tunisia, Turchia, Emirati Arabi Uniti, Ucraina. Il Casin\xF2 far\xE0 ogni ragionevole sforzo per impedire ai giocatori di questi paesi di raggiungere i giochi, ma se i giocatori di uno dei paesi indicati dovessero vincere il jackpot, la vincita del jackpot verr\xE0 annullata.",
  tc38: "7. REGOLE DEL GIOCO",
  tc39: "Accettando questi Termini e Condizioni confermi di essere a conoscenza e di aver compreso le regole dei giochi offerti sul sito web. \xC8 a tua discrezione familiarizzare con la percentuale di vincita teorica di ogni gioco.",
  tc40: "8. ESCLUSIONE DI RESPONSABILITA'",
  tc41: "Accettando questi Termini e Condizioni confermi di essere consapevole del fatto che il gioco d'azzardo pu\xF2 portare alla perdita di denaro. Il Casin\xF2 non \xE8 responsabile per eventuali danni finanziari derivanti dall'utilizzo del sito Web, poich\xE9 l'utilizzo dei nostri servizi \xE8 interamente utilizzato a proprio rischio.",
