  tc44: "Se il Casin\xF2 accredita erroneamente sul tuo Conto Giocatore un deposito, bonus e/o vincite che non ti appartengono, a causa di un problema tecnico, errore nelle tabelle dei pagamenti, errore umano o altro, l'importo e/o le vincite derivanti da tale il bonus o il deposito rimarranno di propriet\xE0 del Casin\xF2 e verranno detratti dal tuo Conto Giocatore. Se hai prelevato fondi che non ti appartengono prima che noi venissimo a conoscenza dell'errore, l'importo erroneamente pagato (fatti salvi altri rimedi e azioni che potrebbero essere disponibili per legge) costituir\xE0 un debito da te nei nostri confronti. Nell'improbabile eventualit\xE0 di un accredito errato, sei tenuto ad avvisarci immediatamente via e-mail.",
  tc45: "Il Casin\xF2, i suoi direttori, dipendenti, partner, fornitori di servizi:",
  tc46: "a) Non garantiscono che il software o il sito web sia/sono adatti al loro scopo;",
  tc47: "b) non garantisce che il software e il sito Web siano esenti da errori;",
  tc48: "c) Non garantiamo che il sito web e/oi giochi saranno accessibili senza interruzioni;",
  tc49: "d) Non sar\xE0 responsabile per eventuali perdite, costi, spese o danni, diretti, indiretti, speciali, consequenziali, incidentali o altro, derivanti dall'utilizzo del sito Web o dalla partecipazione ai giochi.",
  tc50: "e) Con la presente accetti di indennizzare e tenere indenne completamente il Casin\xF2, i suoi direttori, dipendenti, partner e fornitori di servizi per qualsiasi costo, spesa, perdita, danno, reclamo e responsabilit\xE0 comunque causati che potrebbero sorgere in relazione al tuo utilizzo del sito web o la partecipazione ai Giochi.",
  tc51: "Riconosci che il Casin\xF2 sar\xE0 il decisore finale in merito alla tua violazione dei Termini e condizioni del Casin\xF2 in modo tale da comportare la tua sospensione o esclusione permanente dalla partecipazione al sito web.",
  tc52: "9. UTILIZZO DELL'ACCOUNT DEL GIOCATORE",
  tc53: "Ogni giocatore \xE8 autorizzato a creare un solo (1) account personale destinato esclusivamente al proprio uso.",
  tc54: "La creazione di pi\xF9 Conti Giocatore da parte di un singolo Giocatore pu\xF2 comportare, a sola discrezione del Casin\xF2, la chiusura di tutti questi conti e la cancellazione di tutti i pagamenti al Giocatore. Il Giocatore non deve fornire l'accesso al proprio Conto Giocatore o consentire l'utilizzo del Sito Web a terze parti, inclusi, a titolo esemplificativo ma non esaustivo, i minori.",
  tc55: "Eventuali ritorni, vincite o bonus che il Giocatore ha guadagnato o accumulato durante il periodo in cui l'Account duplicato era attivo, possono essere reclamati da noi. I giocatori si impegnano inoltre a restituirci, su richiesta, tutti i fondi che sono stati prelevati dal conto duplicato.",
  tc56: "Il Sito Web pu\xF2 essere utilizzato solo per scopi personali e non deve essere utilizzato per alcun tipo di profitto commerciale.",
  tc57: "\xC8 responsabilit\xE0 del Giocatore mantenere il proprio account e mantenere aggiornati i propri dettagli.",
  tc58: "Ci riserviamo il diritto di effettuare una telefonata al numero fornito nel tuo account utente, che a nostra discrezione pu\xF2 essere una parte necessaria della procedura KYC. Fino a quando l'account non sar\xE0 completamente verificato, non verranno elaborati prelievi. Nel caso in cui il numero di telefono fornito sia errato, mancante o falso o il Giocatore non risponda alla telefonata, ci riserviamo il diritto di confiscare le tue vincite e/o disabilitare il tuo account utente. Faremo uno sforzo concertato per contattarti in merito al prelievo dei tuoi fondi; ma, se non siamo in grado di contattarti via e-mail o telefono entro 30 giorni dalla data della richiesta di prelievo, i fondi verranno trattenuti dalla Societ\xE0 poich\xE9 non hai completato la procedura KYC.",
  tc59: "Saranno richiesti i seguenti passaggi della procedura KYC:",
  tc60: "- Una foto della parte anteriore del documento d'identit\xE0 su un pezzo di carta bianca con la data 'di oggi' scritta sopra e l'ID del giocatore",
  tc61: "che pu\xF2 essere trovato nell'account del giocatore dopo aver effettuato l'accesso",
  tc62: "- Una foto del retro del tuo documento d'identit\xE0 per mostrare la data di scadenza",
  tc63: "- Un selfie con davanti il tuo documento d'identit\xE0",
  tc64: "- Selfie con documento d'identit\xE0 (nessun riflesso, nessuno sfondo occupato; nessun ritaglio)",
  tc65: "10. POLITICA ANTIFRODE",
  tc66: "La Societ\xE0 ha una rigorosa politica antifrode e utilizza vari strumenti e tecniche antifrode. Se il Giocatore \xE8 sospettato di azioni fraudolente tra cui (ma non limitato a):",
  tc67: "a) Creazione di due o pi\xF9 account",
