  tc70: "d) Partecipare a qualsiasi tipo di collusione con altri giocatori",
  tc71: "e) Azioni fraudolente contro altri casin\xF2 online o fornitori di servizi di pagamento",
  tc72: "f) Altri tipi di inganno/imbroglio",
  tc73: "g) O fallisce nel paese di residenza, la Societ\xE0 si riserva il diritto di chiudere tale Conto Giocatore e sospendere e/o annullare tutti i pagamenti al Giocatore. Questa decisione \xE8 a sola discrezione della Societ\xE0 e il Giocatore non sar\xE0 avvisato o informato sui motivi di tali azioni. La Societ\xE0 si riserva inoltre il diritto e potrebbe essere obbligata a informare gli organismi di regolamentazione applicabili delle azioni fraudolente compiute dal Giocatore.",
  tc74: "Il Casin\xF2 adotta una posizione di tolleranza zero per avvantaggiare il gioco. Qualsiasi giocatore che cercher\xE0 di trarre vantaggio dalle offerte di benvenuto del casin\xF2 o da altre promozioni accetta che la Societ\xE0 si riserva il diritto di annullare i bonus e qualsiasi vincita da tali bonus, per i motivi di:",
