  tc76: "2) Utilizzo di carte rubate;",
  tc77: "3) Fornitura di documenti contraffatti/fraudolenti;",
  tc78: "4) Storni di addebito;",
  tc79: "5) Fornire dati di registrazione errati;",
  tc80: "6) Qualsiasi altra azione che possa danneggiare il Casin\xF2.",
  tc81: "Il Casin\xF2 si riserva il diritto di chiudere il Conto Giocatore del Giocatore e di rimborsare al Giocatore l'importo indicato nel saldo del conto, previa detrazione delle relative spese di prelievo, ad assoluta discrezione del Casin\xF2 e senza alcun obbligo di motivazione o preavviso.",
  tc82: "Per verificare l'account di un giocatore, la direzione del casin\xF2 richieder\xE0 documenti (carta d'identit\xE0, sistemi di pagamento, bollette ecc.) in alfabeto latino o cirillico come parte della procedura KYC. Nel caso in cui il Giocatore non abbia l'opportunit\xE0 di fornire documenti negli alfabeti sopra menzionati, il casin\xF2 si riserva il diritto di richiedere una verifica video in cui il Giocatore mostra i propri documenti.",
